import kasaLogo2 from "./asset/images/D_Footer.png";

function Footer () {

return (
    <div className="kasa-footer-banner">
      <div className="kasa-footer-titre">
      <img src={kasaLogo2} alt="logo Kasa noir et blanc"></img>
      </div>
    </div>
  );
}

export default Footer
